con:restMockAction.con:dispatchPath:
import groovy.json.JsonSlurper;

// Match based on header
def contentType = mockRequest.getRequestHeaders().get("Content-Type");
log.info "Content-Type Header: " + contentType;

if (!contentType.contains("application/json")) {
	log.error "Invalid Content-Type";
	return "ERROR";
}

// Match based on body
def requestBody = mockRequest.getRequestContent();
log.info "Request body: " + requestBody;

def requestJson = new JsonSlurper().parseText(requestBody);

if (!(requestJson instanceof Map)) {
	log.error "Invalid request body";
	return "ERROR";
}
if (!(
	requestJson.containsKey('personcode') &&
	requestJson.containsKey('logtime') &&
	requestJson.containsKey('action') &&
	requestJson.containsKey('sender') &&
	requestJson.containsKey('receiver') &&
	requestJson.containsKey('restrictions') &&
	requestJson.containsKey('sendercode') &&
	requestJson.containsKey('receivercode') &&
	requestJson.containsKey('actioncode') &&
	requestJson.containsKey('xroadrequestid') &&
	requestJson.containsKey('xroadservice') &&
	requestJson.containsKey('usercode')
	)) {
		log.error "Missing field";
		return "ERROR";
	}
if (
	requestJson.personcode != "47101010033" ||
	!requestJson.logtime.matches(/^2016-[0-9]{2}-[0-9]{2}T[0-9]{2}:[0-9]{2}:[0-9]{2}$/) ||
	requestJson.action != "Get Person Data" ||
	requestJson.sender != "Test AK" ||
	requestJson.receiver != "Test receiver" ||
	requestJson.restrictions != "A" ||
	requestJson.sendercode != "20000001" ||
	requestJson.receivercode != "10000001" ||
	requestJson.actioncode != "getPersonData" ||
	!requestJson.xroadrequestid.matches(/^[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12}$/) ||
	requestJson.xroadservice != "getPersonData" ||
	requestJson.usercode != "EE12345678901"
	) {
		log.error "Invalid data";
		return "ERRDATA";
	}


return "OK";
